import './App.css';

import Sigma from 'react-sigma';
import SigmaGraph from './SigmaGraph';
function App() {
  const graph = {
    nodes: [
      { id: 'n1', label: 'Node 1', x: 0, y: 0, size: 10, color: '#ff0000' },
      { id: 'n2', label: 'Node 2', x: 100, y: 100, size: 10, color: '#00ff00' },
      { id: 'n3', label: 'Node 3', x: 100, y: 100, size: 10, color: '#00ff00' },
      { id: 'n4', label: 'Node 4', x: 100, y: 100, size: 10, color: '#00ff00' },
    ],
    edges: [
      { id: 'e1', source: 'n1', target: 'n2', label: 'Edge from Node 1 to Node 2' },
      { id: 'e2', source: 'n1', target: 'n3', label: 'Edge from Node 1 to Node 2' },
      { id: 'e3', source: 'n1', target: 'n4', label: 'Edge from Node 1 to Node 2' },
    ],
  };
  return (

    <div>
      <header>
        <SigmaGraph/>
      </header>
    </div>
  );
}

export default App;
